(self.webpackChunkjakezien=self.webpackChunkjakezien||[]).push([[927],{3208:function(e,t,n){"use strict";n.r(t),n.d(t,{_frontmatter:function(){return r},default:function(){return s}});var o=n(9756),a=(n(7294),n(3497)),r={},i={_frontmatter:r};function s(e){var t=e.components,n=(0,o.Z)(e,["components"]);return(0,a.mdx)("wrapper",Object.assign({},i,n,{components:t,mdxType:"MDXLayout"}),(0,a.mdx)("h1",null,"What I’ve done"),(0,a.mdx)("h3",null,"CBRE — Lead product designer"),(0,a.mdx)("p",null,"March 2020-Present\nIn this role, I lead design strategy for systems-level projects that affect applications used by CBRE employees on every continent. I work with CBRE’s top executives as stakeholders and partners, and collaborate with a team of designers across the globe."),(0,a.mdx)("h3",null,"CBRE Build — Senior product designer; Creative director"),(0,a.mdx)("p",null,"Jan 2017–Mar 2020\nI initiated and led a project to create a new brand identity for our new team at CBRE. When our startup, Floored, was acquired by the Big Green Machine, we sacrificed our name and logo — and with them, our ability to recruit NYC’s best technologists. To me, this was a branding issue, so I developed a new visual, verbal, and cultural identity that defined our group’s position and role to our new parent company — and to our existing team. I collaborated with CBRE’s Global Marketing Team, culminating in a final, one-on-one pitch to CBRE CEO Bob Sulentic, who received it with warm enthusiasm and a big thumbs up. The project was featured on Brand New. Events, swag, recruiting success.\nAlso at CBRE Build, I co-led a team to develop Site IQ, a application built from the ground up.\nAlso touched half a dozen other products."),(0,a.mdx)("h3",null,"Floored — Lead designer"),(0,a.mdx)("p",null,"Summer 2012 – Dec 2016\nI was the second employee of this startup. Hired initially as a contract UI designer to make a logo and website, I grew the role to a full time product design position, stumbling often and learning UX fundamentals on the fly.  For the first two years, I was the company’s only design or product person. I led the design for Floored’s two products, web apps for 3D real estate tours and floor planning.\nChallenges of designing for a tough user and coming into the design process too late."),(0,a.mdx)("h3",null,"Quirky — Contract UI designer"),(0,a.mdx)("p",null,"2012\nI was hired to produce UI designs for Quirky’s iOS app, which allowed users to view, comment on, and vote for invention ideas, as well as submit ideas of their own."),(0,a.mdx)("h3",null,"Stamped — Product designer"),(0,a.mdx)("p",null,"2011\nStraight out of college, I was the first design hire at this NYC-based social media startup. (In a savvy move by Stamped’s founders, I was quickly paired with a manager/mentor, a designer with a decade of experience at Google and Apple.) Our app had a great idea and a unique, typographically-driven, ahead-of-its time UI. Justin Bieber was an early user, John Gruber wrote approvingly of our launch, and after less than 2 years, the company found a $10m exit in an acqui-hire by Yahoo."),(0,a.mdx)("h3",null,"RISD — BFA Graphic Design, Brown University — Minor in Computer Science"),(0,a.mdx)("p",null,"2007–2011\nI took advantage of the two schools’ cross registration policy to supplement my RISD graphic design education with computer science classes at Brown. My thesis project, Points, imagined a future where design software shed its painterly roots in favor of tools and workflows more appropriate to screen design. (This future is now playing out in Sketch and Figma.) Honors included a faculty award for my thesis project, personal invitation to dine at the home of RISD’s president, and ",(0,a.mdx)("strong",{parentName:"p"},(0,a.mdx)("strong",{parentName:"strong"},"____")),"."),(0,a.mdx)("h3",null,"Nicolet High School"),(0,a.mdx)("p",null,"2003-2007\nYou don’t really care what I did in high school, do you? I was on the studious track, the one crammed with AP exams, honor rolls, early mornings and late nights. Though I felt my true passions lay in design, my specialty extracurricular was theater, where I played the following roles. ","[link to oklahoma on yt]"))}s.isMDXComponent=!0}}]);
